easymeeting S è l'app che ti permette di partecipare direttamente dal tuo tablet a riunioni easymeeting™ con audio & video anche a qualità HD e guardare i documenti e le applicazioni condivise.

Per utilizzare easymeeting S è richiesto un account easymeeting™. 

Condividi i tuoi documenti, lavora a più mani sullo stesso progetto, impara grazie ai questionari in tempo reale e registra tutti i tuoi meeting, ovunque tu sia! 

Ad easymeeting™ puoi accedere da PC, Mac, tablet o dal tuo smartphone.


Caratteristiche di easymeeting S: 

· Accesso alle video conferenze easymeeting™;
· Visualizzazione della condivisione di applicazione e documenti;
· Selezione della webcam (frontale o posteriore);
· Uso con o senza auricolari (grazie al cancellatore d'eco integrato);
· Fino a 20 canali video Full-Duplex;
· Altri partecipanti in low refresh.


Caratteristiche di easymeeting™: 

· Più di 1.000 utenti in ciascuna riunione, in illimitate sessioni contemporanee; 
· Fino a 20 utenti interattivi nelle finestre Full-Duplex; 
· Consumo di banda e qualità audio, video e dati completamente parametrizzabile; 
· Interfaccia semplice e personalizzabile; 
· Flusso audio, video e dati completamente crittografato con algoritmo scelto dal cliente; 
· Finestre ridimensionabili, posizionabili ed autoadattanti in relazione agli utenti ed alle funzionalità; 
· Fino a 8 canali audio indipendenti per gestire le comunicazioni multilingua; 
· Layout personalizzabile su più monitor (fino a otto) memorizzabile e richiamabile rapidamente; 
· Invio di file e filmati in tempo reale; 
· Screen sharing per la condivisione diretta di file e applicativi; 
· Whiteboard e Videopointer; 
· Chat integrata fra tutti gli utenti; 
· Sincronizzazione file Powerpoint; 
· Sessione completa registrabile da parte di ogni utente; 
· Sistema di scheduling web-based per invitare i partecipanti alla riunione; 
· Instant messaging; 
· videolearning™ per la gestione della formazione interattiva; 
· integrazione con telefonia e con la videoconferenza tradizionale.
